import React, { Component } from "react";
import {Link} from "react-router-dom";
import About from "./About";
import BrainTrust from "./BrainTrust";
import Careers from "./Careers";
import Contact from "./Contact";
import Content from "./Content";
import CorporateCitizenship from "./CorporateCitizenship";
import Home from "./Home";
import Movement from "./Movement";
import OrganizationalDesign from "./OrganizationalDesign";
import Partenship from "./Partnership";
import StrategyManagement from "./StrategyManagement";
import imgLogo from "./img/temboGroupLogo.png";

class App extends Component {
  render() {
    return (
      <HashRouter>
        <div>
          <div className="divHeaderContainer">
            <div className="divHeader leftHeader">
              <img src={imgLogo} className="imgLogo" alt="imgLogo"/>
            </div>
            <div className="divHeader rightHeader">
              <ul className="header">
                <li className="borderRight"><Link to="/">SERVICES</Link></li>
                <li className="borderRight"><Link to="/brainTrust">BRAIN TRUST</Link></li>
                <li className="borderRight"><Link to="/careers">CAREERS</Link></li>
                <li className="borderRight"><Link to="/about">ABOUT</Link></li>
                <li><Link to="/contact">CONTACT</Link></li>
              </ul>
            </div>
          </div>
          <div>

          </div>
        </div>
      </HashRouter>
    );
  }
}

export default App;
